import React from "react";
import { IMAGE_BASE_URL } from "../../../config";

const Actor = props => {
  const POSTER_SIZE = "w154";
  return (
    <div className="rmdb-actor">
      <img
        src={
          props.actor.profile_path
            ? `${IMAGE_BASE_URL}${POSTER_SIZE}${props.actor.profile_path}`
            : "./images/no_image.jpg"
        }
        alt="actorthumn"
      />
    </div>
  );
};

export default Actor;
